window.bookSummaryJSON = "<p>Book six in the best-selling Meg series picks up after <i>Meg: Nightstalkers</i> with David Taylor in the Salish sea, attempting to locate and rescue any surviving Megalodon pups before a local fisherman slaughters them. Meanwhile, Jonas is coerced into joining an expedition into the Panthalassa sea in search of a prehistoric predatory species possessing liver enzymes that can cure cancer.&nbsp;</p>"; 
